import React from 'react';
import './NavBar.css';

const NavBar = (props) => {
  return (
    <nav className="nav-bar">
      <img src="" alt=""/>
      <ul className="nav-links">
        <li className="nav-item">
            <a href="#">HOME</a>
        </li>
        <li className="nav-item">
            <a href="#">ORDER</a>
        </li>
        <li className="nav-item">
            <a href="#">CART</a>
        </li>
      </ul>
    </nav>
  );

  /*
    {auth.isLoggedIn && (
      <li>
        <NavLink to="#">ACCOUNT</NavLink>
      </li>
    )}
    {!auth.isLoggedIn && (
      <li>
        <NavLink to="#">LOGIN</NavLink>
      </li>
    )}
  */    
};

export default NavBar;
